import React from "react";

const guitars = [
  {
    name: "Petel",
    spec: "Telecaster with P90 neck & single-coil bridge",
    details: "Swamp Ash body, Maple neck, Rosewood fingerboard, Tung oil finish, Bigsby bridge, Kill switch, Custom head shape"
  }
];

export default function Guitars() {
  return (
    <div className="px-6 py-12 max-w-4xl mx-auto">
      <h2 className="text-3xl font-bold tracking-tight mb-8 text-center uppercase">Handcrafted Guitars</h2>
      <div className="space-y-4">
        {guitars.map((guitar, index) => (
          <div key={index} className="border rounded-xl p-4 hover:shadow-md transition bg-white/70 backdrop-blur-sm">
            <p className="text-lg font-semibold text-gray-800">{guitar.name}</p>
            <p className="text-sm text-gray-600 italic">{guitar.spec}</p>
            <p className="text-sm mt-1 text-gray-700">{guitar.details}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
